                                        <div class=""tableProd features"">
                                            <h1 class=""trackingText"">Features</h1>
                                            <ul class=""productFeatures"">
                                                <li class=""trackingText2""> <strong>A Complex and Emotional Story </strong> - Experience the escalating moral conflicts created by Ellie's relentless pursuit of vengeance. The cycle of violence left in her wake will challenge your notions of right versus wrong, good");
                WriteLiteral(@" versus evil, and hero versus villain. </li>
                                                <li class=""trackingText2""> <strong>A Beautiful Yet Dangerous World</strong> - Set out on Ellie's journey, taking her from the peaceful mountains and forests of Jackson to the lush, overgrown ruins of greater Seattle. Encounter new survivor groups, unfamiliar and treacherous environments, and terrifying evolutions of the infected. Brought to life by the latest iteration of the Naughty Dog engine, the deadly characters and world are more realistic and meticulously detailed than ever before. </li>
                                                <li class=""trackingText2""> <strong>Tense and Desperate Action-Survival Gameplay </strong> - New and evolved gameplay systems deliver upon the life-or-death stakes of Ellie's journey through the hostile world. Feel her desperate struggle for survival through improved features such as high-intensity melee combat, fluid movement, and dynamic stealth. A broad variety of weapons, cra");
                WriteLiteral(@"fting items, skills, and upgrades allows you to personalize Ellie's capabilities to your play style. </li>
                                            </ul>
                                            <hr style=""color: #d5d5d5; opacity: .75;margin: 2.5rem 0;"" class=""border-structure 2131"">
                                        </div>
                                        <div class=""tableProd description"">
                                            <h1 class=""trackingText"">Product Description</h1>
                                            <p class=""trackingText2 body-text"">A double pack containing the Pokémon Scarlet and Pokémon Violet games is available for the Nintendo Switch at GameStop. The packaged version includes 1 physical Pokémon Scarlet game and 1 physical Pokémon Violet game. The Pokémon Scarlet & Pokémon Violet Double Pack will release on 11/18/2022.</p>
                                            <p class=""trackingText2 body-text"">The newest chapters in the Pokémon™ series, the Poké");
