                                <div class=""tableProd features"">
                                    <h1 class=""trackingText"">Features</h1>
                                    <ul class=""productFeatures"">
                                        <li class=""trackingText2""> <strong>A Complex and");
                WriteLiteral(@" Emotional Story </strong> - Experience the escalating moral conflicts created by Ellie's relentless pursuit of vengeance. The cycle of violence left in her wake will challenge your notions of right versus wrong, good versus evil, and hero versus villain. </li>
                                        <li class=""trackingText2""> <strong>A Beautiful Yet Dangerous World</strong> - Set out on Ellie's journey, taking her from the peaceful mountains and forests of Jackson to the lush, overgrown ruins of greater Seattle. Encounter new survivor groups, unfamiliar and treacherous environments, and terrifying evolutions of the infected. Brought to life by the latest iteration of the Naughty Dog engine, the deadly characters and world are more realistic and meticulously detailed than ever before. </li>
                                        <li class=""trackingText2""> <strong>Tense and Desperate Action-Survival Gameplay </strong> - New and evolved gameplay systems deliver upon the life-or-death stakes of Ellie's journe");
                WriteLiteral(@"y through the hostile world. Feel her desperate struggle for survival through improved features such as high-intensity melee combat, fluid movement, and dynamic stealth. A broad variety of weapons, crafting items, skills, and upgrades allows you to personalize Ellie's capabilities to your play style. </li>
                                    </ul>
                                    <hr style=""color: #d5d5d5; opacity: .75;margin: 2.5rem 0;"" class=""border-structure 2131"">
                                </div>
                                <div class=""tableProd description"">
                                    <h1 class=""trackingText"">Product Description</h1>
                                    <p class=""trackingText2 body-text"">In Last of Us Part II follow Ellie and Joel while they settle down in Jackson, Wyoming. Five years after their dangerous journey across post-pandemic America, they live amongst a community of survivors. In this community they have found peace and stability, but still remember t");
                WriteLiteral(@"he constant threat of the infected and not so friendly survivors.</p>
                                    <p class=""trackingText2 body-text"">The newest chapters in the Pokémon™ series, the Pokémon Scarlet and Pokémon Violet games, are coming to the Nintendo Switch™ system later this year. As the main character, you can explore the wide-open world of Pokémon Scarlet and Violet at your own pace. In these games, you’ll be able to enjoy the iconic adventures of the Pokémon series, like battling against wild Pokémon and trying to catch them! Choose either Sprigatito, the Grass Cat Pokémon, Fuecoco, the Fire Croc Pokémon, or Quaxly, the Duckling Pokémon to be your first partner Pokémon before setting off on your journey through this new region.</p>
                                    <strong class=""strongText"">Explore freely in the rich open world of Pokémon Scarlet and Violet </strong>
                                    <p class=""trackingText2 body-text"">The newest chapters in the Pokémon™ series, the Pokémon ");
                WriteLiteral(@"Scarlet and Pokémon Violet games, are coming to the Nintendo Switch™ system later this year. As the main character, you can explore the wide-open world of Pokémon Scarlet and Violet at your own pace. In these games, you’ll be able to enjoy the iconic adventures of the Pokémon series, like battling against wild Pokémon and trying to catch them! Choose either Sprigatito, the Grass Cat Pokémon, Fuecoco, the Fire Croc Pokémon, or Quaxly, the Duckling Pokémon to be your first partner Pokémon before setting off on your journey through this new region.</p>
                                    <p class=""trackingText2 body-text"">The newest chapters in the Pokémon™ series, the Pokémon Scarlet and Pokémon Violet games, are coming to the Nintendo Switch™ system later this year. As the main character, you can explore the wide-open world of Pokémon Scarlet and Violet at your own pace. In these games, you’ll be able to enjoy the iconic adventures of the Pokémon series, like battling against wild Pokémon and trying to catch ");
                WriteLiteral(@"them! Choose either Sprigatito, the Grass Cat Pokémon, Fuecoco, the Fire Croc Pokémon, or Quaxly, the Duckling Pokémon to be your first partner Pokémon before setting off on your journey through this new region.</p>
                                    <p class=""trackingText2 body-text"">The newest chapters in the Pokémon™ series, the Pokémon Scarlet and Pokémon Violet games, are coming to the Nintendo Switch™ system later this year. As the main character, you can explore the wide-open world of Pokémon Scarlet and Violet at your own pace. In these games, you’ll be able to enjoy the iconic adventures of the Pokémon series, like battling against wild Pokémon and trying to catch them! Choose either Sprigatito, the Grass Cat Pokémon, Fuecoco, the Fire Croc Pokémon, or Quaxly, the Duckling Pokémon to be your first partner Pokémon before setting off on your journey through this new region.</p>
